

CREATE TABLE `customer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(20) NOT NULL,
  `fullname` varchar(100) NOT NULL,
  `image` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `birthday` datetime NOT NULL,
  `gender` tinyint(1) NOT NULL,
  `married` tinyint(1) NOT NULL,
  `phone` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `address` varchar(100) NOT NULL,
  `title_company` varchar(50) NOT NULL,
  `fax_company` varchar(50) NOT NULL,
  `mst_company` varchar(50) NOT NULL,
  `address_company` varchar(50) NOT NULL,
  `order` int(11) NOT NULL,
  `trash` tinyint(4) NOT NULL,
  `userid_created` int(11) NOT NULL,
  `created` datetime NOT NULL,
  `userid_updated` int(11) NOT NULL,
  `updated` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=364 DEFAULT CHARSET=utf8;



